function check_element(e){var t=100/document.getElementsByTagName("*").length;if($(e).on()){var n=t+Number(document.getElementById("progress_width").value);document.getElementById("progress_width").value=n,$("#bar").animate({width:n+"%"},10,(function(){"100%"==document.getElementById("bar").style.width&&($(".preloader").fadeOut(2e3),setTimeout((function(){fullpage_api.setAllowScrolling(!0),fullpage_api.setKeyboardScrolling(!0)}),1e3))}))}else set_ele(e)}function set_ele(e){check_element(e)}document.onreadystatechange=function(e){if("interactive"==document.readyState)for(var t=document.getElementsByTagName("*"),n=0,l=t.length;n<l;n++)set_ele(t[n])};